//   "source": "// SPDX-License-Identifier: MIT\r\npragma solidity >=0.8.0 <0.9.0;\r\n\r\n/**\r\n * @title UserRegistry\r\n * @dev Manages user registration and roles within the agricultural platform.\r\n */\r\ncontract UserRegistry {\r\n    // Address of the contract owner/administrator\r\n    address public owner;\r\n\r\n    // Enum to define the possible roles for users\r\n    enum UserRole { Unassigned, Farmer, Vendor, Consumer, Bank, Insurance, Verifier }\r\n\r\n    // Struct to hold user information\r\n    struct User {\r\n        address userAddress;\r\n        string name;\r\n        UserRole role;\r\n        bool isRegistered;\r\n    }\r\n\r\n    // Mapping from user addresses to their details\r\n    mapping(address => User) public users;\r\n    // Keep a list of all registered user addresses\r\n    address[] public userAddresses;\r\n\r\n    // Events to log important actions\r\n    event UserRegistered(address indexed userAddress, string name, UserRole role);\r\n    event RoleUpdated(address indexed userAddress, UserRole newRole);\r\n\r\n    modifier onlyOwner() {\r\n        require(msg.sender == owner, \"Only the owner can call this function\");\r\n        _;\r\n    }\r\n\r\n    constructor() {\r\n        owner = msg.sender;\r\n        // Register the contract owner with a default role (e.g., Verifier)\r\n        _registerUser(\"Admin\", UserRole.Verifier);\r\n    }\r\n\r\n    /**\r\n     * @dev Internal function to handle user registration.\r\n     */\r\n    function _registerUser(string memory _name, UserRole _role) internal {\r\n        require(!users[msg.sender].isRegistered, \"User is already registered.\");\r\n        users[msg.sender] = User(msg.sender, _name, _role, true);\r\n        userAddresses.push(msg.sender);\r\n        emit UserRegistered(msg.sender, _name, _role);\r\n    }\r\n\r\n    /**\r\n     * @dev Allows new users to register for a specific role.\r\n     */\r\n    function registerAsFarmer(string memory _name) public {\r\n        _registerUser(_name, UserRole.Farmer);\r\n    }\r\n\r\n    function registerAsVendor(string memory _name) public {\r\n        _registerUser(_name, UserRole.Vendor);\r\n    }\r\n\r\n    function registerAsConsumer(string memory _name) public {\r\n        _registerUser(_name, UserRole.Consumer);\r\n    }\r\n    \r\n    // Functions for admin to add institutional roles\r\n    function addBank(address _bankAddress, string memory _name) public onlyOwner {\r\n        require(!users[_bankAddress].isRegistered, \"Bank is already registered.\");\r\n        users[_bankAddress] = User(_bankAddress, _name, UserRole.Bank, true);\r\n        userAddresses.push(_bankAddress);\r\n        emit UserRegistered(_bankAddress, _name, UserRole.Bank);\r\n    }\r\n\r\n    function addInsurance(address _insuranceAddress, string memory _name) public onlyOwner {\r\n         require(!users[_insuranceAddress].isRegistered, \"Insurance co. is already registered.\");\r\n        users[_insuranceAddress] = User(_insuranceAddress, _name, UserRole.Insurance, true);\r\n        userAddresses.push(_insuranceAddress);\r\n        emit UserRegistered(_insuranceAddress, _name, UserRole.Insurance);\r\n    }\r\n    \r\n    function addVerifier(address _verifierAddress, string memory _name) public onlyOwner {\r\n         require(!users[_verifierAddress].isRegistered, \"Verifier is already registered.\");\r\n        users[_verifierAddress] = User(_verifierAddress, _name, UserRole.Verifier, true);\r\n        userAddresses.push(_verifierAddress);\r\n        emit UserRegistered(_verifierAddress, _name, UserRole.Verifier);\r\n    }\r\n\r\n\r\n    /**\r\n     * @dev Fetches the role for a given user address.\r\n     */\r\n    function getRole(address _userAddress) public view returns (UserRole) {\r\n        return users[_userAddress].role;\r\n    }\r\n}\r\n",
