//   "source": "// SPDX-License-Identifier: MIT\r\npragma solidity >=0.8.0 <0.9.0;\r\n\r\nimport \"./UserRegistry.sol\";\r\n\r\n/**\r\n * @title ProductLedger\r\n * @dev Manages the creation, tracking, and verification of agricultural products.\r\n */\r\ncontract ProductLedger {\r\n    // Reference to the UserRegistry contract to check roles\r\n    UserRegistry public userRegistry;\r\n\r\n    // Counter for unique product IDs\r\n    uint256 public productCounter;\r\n\r\n    // Enum for farming practices\r\n    enum FarmingPractice { Conventional, Organic }\r\n\r\n    // Enum for the product's current stage in the supply chain\r\n    enum ProductStage { Harvested, InTransit, AtVendor, Sold }\r\n    \r\n    // Struct to hold details about each product batch\r\n    struct Product {\r\n        uint256 id;\r\n        string name;\r\n        address farmer;\r\n        uint256 harvestDate;\r\n        FarmingPractice practice;\r\n        bool isVerified;\r\n        ProductStage stage;\r\n        address currentOwner;\r\n    }\r\n    \r\n    // Struct to log each step in the product's journey\r\n    struct TraceEvent {\r\n        ProductStage stage;\r\n        address actor;\r\n        uint256 timestamp;\r\n    }\r\n\r\n    // Mapping from product ID to its details\r\n    mapping(uint256 => Product) public products;\r\n    // Mapping from product ID to its history\r\n    mapping(uint256 => TraceEvent[]) public history;\r\n    // Mapping from verifier address to the products they have verified\r\n    mapping(address => uint256[]) public verifiedProducts;\r\n\r\n    // Events\r\n    event ProductAdded(uint256 indexed id, string name, address indexed farmer);\r\n    event ProductVerified(uint256 indexed id, address indexed verifier);\r\n    event StageUpdated(uint256 indexed id, ProductStage newStage, address indexed newOwner);\r\n\r\n    constructor(address _userRegistryAddress) {\r\n        userRegistry = UserRegistry(_userRegistryAddress);\r\n        productCounter = 0;\r\n    }\r\n    \r\n    /**\r\n     * @dev Allows a registered farmer to add a new product batch.\r\n     */\r\n    function addProduct(string memory _name, FarmingPractice _practice) public {\r\n        require(userRegistry.getRole(msg.sender) == UserRegistry.UserRole.Farmer, \"Only farmers can add products.\");\r\n        \r\n        productCounter++;\r\n        \r\n        products[productCounter] = Product({\r\n            id: productCounter,\r\n            name: _name,\r\n            farmer: msg.sender,\r\n            harvestDate: block.timestamp,\r\n            practice: _practice,\r\n            isVerified: false,\r\n            stage: ProductStage.Harvested,\r\n            currentOwner: msg.sender\r\n        });\r\n\r\n        _addHistory(productCounter, ProductStage.Harvested);\r\n        emit ProductAdded(productCounter, _name, msg.sender);\r\n    }\r\n    \r\n    /**\r\n     * @dev Allows a registered verifier to certify a product's farming practice.\r\n     */\r\n    function verifyProduct(uint256 _id) public {\r\n        require(userRegistry.getRole(msg.sender) == UserRegistry.UserRole.Verifier, \"Only verifiers can certify products.\");\r\n        require(_id > 0 && _id <= productCounter, \"Product does not exist.\");\r\n        \r\n        products[_id].isVerified = true;\r\n        verifiedProducts[msg.sender].push(_id);\r\n        \r\n        emit ProductVerified(_id, msg.sender);\r\n    }\r\n\r\n    /**\r\n     * @dev Internal function to add a trace event to a product's history.\r\n     */\r\n    function _addHistory(uint256 _id, ProductStage _stage) internal {\r\n        history[_id].push(TraceEvent({\r\n            stage: _stage,\r\n            actor: msg.sender,\r\n            timestamp: block.timestamp\r\n        }));\r\n    }\r\n\r\n    /**\r\n     * @dev Updates the stage of a product and transfers ownership.\r\n     */\r\n    function updateStageToTransit(uint256 _id) public {\r\n        // Can be called by farmer or vendor\r\n        require(_id > 0 && _id <= productCounter, \"Product does not exist.\");\r\n        require(products[_id].currentOwner == msg.sender, \"You are not the current owner.\");\r\n        products[_id].stage = ProductStage.InTransit;\r\n        _addHistory(_id, ProductStage.InTransit);\r\n        emit StageUpdated(_id, ProductStage.InTransit, msg.sender); // Owner remains sender (transporter)\r\n    }\r\n\r\n    function updateStageToVendor(uint256 _id) public {\r\n        // Only a registered vendor can receive the product\r\n        require(userRegistry.getRole(msg.sender) == UserRegistry.UserRole.Vendor, \"Only vendors can receive products.\");\r\n        require(_id > 0 && _id <= productCounter, \"Product does not exist.\");\r\n        products[_id].stage = ProductStage.AtVendor;\r\n        products[_id].currentOwner = msg.sender;\r\n        _addHistory(_id, ProductStage.AtVendor);\r\n        emit StageUpdated(_id, ProductStage.AtVendor, msg.sender);\r\n    }\r\n    \r\n    function updateStageToSold(uint256 _id) public {\r\n        // Can be sold by a vendor\r\n        require(userRegistry.getRole(msg.sender) == UserRegistry.UserRole.Vendor, \"Only vendors can sell products.\");\r\n        require(products[_id].currentOwner == msg.sender, \"You are not the current owner.\");\r\n        products[_id].stage = ProductStage.Sold;\r\n        _addHistory(_id, ProductStage.Sold);\r\n        emit StageUpdated(_id, ProductStage.Sold, msg.sender);\r\n    }\r\n\r\n    /**\r\n     * @dev Fetches all details for a specific product.\r\n     */\r\n    function getProductDetails(uint256 _id) public view returns (Product memory) {\r\n        require(_id > 0 && _id <= productCounter, \"Product does not exist.\");\r\n        return products[_id];\r\n    }\r\n    \r\n    /**\r\n     * @dev Fetches the full history for a specific product.\r\n     */\r\n    function getProductHistory(uint256 _id) public view returns (TraceEvent[] memory) {\r\n        return history[_id];\r\n    }\r\n}\r\n",
